impl Solution {
    pub fn number_of_good_subarray_splits(nums: Vec<i32>) -> i32 {
        let mut prefix_count = 0;
        let mut suffix_count = nums.iter().filter(|&&x| x == 1).count() as i32;
        let mut ans = 0;
        const MOD: i32 = 1_000_000_007;

        for &num in &nums[..nums.len() - 1] {
            if num == 1 {
                prefix_count += 1;
                suffix_count -= 1;
            }
            if prefix_count == 1 && suffix_count == 1 {
                ans = (ans + 1) % MOD;
            }
        }

        ans
    }
}
